import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AuthPage from './pages/auth'; // ✅ Use only this, remove the './pages/Auth' line
import Dashboard from './pages/Dashboard';
import PrivateRoute from './components/PrivateRoute'; // ✅ Add this if using auth protection
import LoginUI from './pages/LoginUI';




function App() {
  return (
    <Router>
      <Routes>
        {/* Login/Register tab page */}
        <Route path="/" element={<AuthPage />} />
        <Route path="/login-ui" element={<LoginUI />} />

        {/* Protected dashboard */}
        <Route
          path="/dashboard"
          element={
            <PrivateRoute>
              <Dashboard />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
